AAAAAAAAAAg4cEBwAA\nAAAAAAAYPCQ4AAAAAAAAAMDgIcEBAAAAAAAAAAYPCQ4AAAAAAAAAMHhIcAAAAAAAAACAwUOC\nAwAAAAAAAAAMHhIcAAAAAAAAAGDwkOAAAAAAAAAAAIOHBAcAAAAAAAAAGDwkOAAAAAAAAADA\n4CHBAQAAAAAAAAAGDwkOAAAAAAAAADB4SHAAAAAAAAAAgMFDggMAAAAAAAAADB4SHAAAAAAA\nAABg8JDgAAAAAAAAAACDhwQHAAAAAAAAABg8JDgAAAAAAAAAwOAhwQEAAAAAAAAABg8JDgAA\nAAAAAAAweEhwAAAAAAAAAIDBQ4IDAAAAAAAAAAweEhwAAAAAAAAAYPCQ4AAAAAAAAAAAg4cE\nBwAAAAAAAAAYPCQ4AAAAAAAAAMDgIcEBAAAAAAAAAAYPCQ4AAAAAAAAAMHhIcAAAAAAAAACA\nwUOCAwAAAAAAAAAMHhIcAAAAAAAAAGDw/gc2LxFIdMShGQAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"width":720,"height":480}}}],"execution_count":112},{"cell_type":"markdown","source":"# VERİ ÖN İŞLEME \n# Eksik verilerin doldurulması :\n**# # # mice() (Multivariate Imputation by Chained Equations)**# **** \n\nEksik verilerin çok değişkenli istatistiksel modeller kullanılarak \ndoldurulmasını sağlayan güçlü bir R paketidir. \nTemel yaklaşımı, her bir eksik değişkeni diğer değişkenler yardımıyla \nayrı ayrı tahmin etmeye dayanır.\nZincirleme regresyon modeli (chained equations) ile çalışır.\nEksik veriye sahip her değişken için özel bir tahmin modeli kurar.\nEksiklik oranı yüksek verilerde daha güvenilir sonuçlar üretir.\nMevsim, saat gibi zamansal bileşenler dahil edilerek tahmin gücü artırılabilir.\n\npm10, so2, o3, prcp, no2 gibi negatif değer alamaz değişkenleri, \nmice() kullanarak yalnızca pozitif değerlerle tahmin etmek.\nÖZEL TAHMİN FONKSİYONU: norm.positive","metadata":{}},{"cell_type":"code","source":"library(mice)\nveri_mice <- data %>%\n  select(pm10, so2, no2, o3, prcp, wdir, pres, temp, rhum, wspd, hour, month, season)\n\nveri_mice$season <- as.factor(veri_mice$season)\n\n### Eksik verileri mice() ile tamamla\nimp_all <- mice(veri_mice, m = 1, method = \"norm.predict\", seed = 42)\n\n##### Tamamlanan verileri ana veri setine aktar\n\ntamamlanan <- complete(imp_all)\n\ndata$pm10_imputed <- tamamlanan$pm10\ndata$so2_imputed  <- tamamlanan$so2\ndata$no2_imputed  <- tamamlanan$no2\ndata$o3_imputed   <- tamamlanan$o3\ndata$prcp_imputed <- tamamlanan$prcp\ndata$wdir_imputed <- tamamlanan$wdir\ndata$pres_imputed <- tamamlanan$pres","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T10:49:45.223477Z","iopub.execute_input":"2025-05-21T10:49:45.225249Z","iopub.status.idle":"2025-05-21T10:49:49.986108Z","shell.execute_reply":"2025-05-21T10:49:49.981733Z"}},"outputs":[{"name":"stdout","text":"\n iter imp variable\n  1   1  pm10  so2  no2  o3  prcp  wdir  pres\n  2   1  pm10  so2  no2  o3  prcp  wdir  pres\n  3   1  pm10  so2  no2  o3  prcp  wdir  pres\n  4   1  pm10  so2  no2  o3  prcp  wdir  pres\n  5   1  pm10  so2  no2  o3  prcp  wdir  pres\n","output_type":"stream"}],"execution_count":113},{"cell_type":"markdown","source":"# #  Yeni veri setini \"data_r\" olarak tanımlanması  # ","metadata":{}},{"cell_type":"code","source":"# Yeni veri setini tanımla\ndata_r <- data %>%\n  transmute(\n    datetime = datetime,  # zaman bilgisi\n    year = year,\n    month = month,\n    day = day,\n    hour = hour,\n    season = season,\n    \n    # MICE ile tamamlanmış değişkenler\n    pm10 = pm10_imputed,\n    so2 = so2_imputed,\n    no2 = no2_imputed,\n    o3 = o3_imputed,\n    prcp = prcp_imputed,\n    wdir = wdir_imputed,\n    pres = pres_imputed,\n    \n    # Eksiksiz olan diğer değişkenler (örn: meteoroloji)\n    temp = temp,\n    rhum = rhum,\n    wspd = wspd\n  )\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T10:50:01.736217Z","iopub.execute_input":"2025-05-21T10:50:01.737951Z","iopub.status.idle":"2025-05-21T10:50:01.760160Z","shell.execute_reply":"2025-05-21T10:50:01.757448Z"}},"outputs":[],"execution_count":114},{"cell_type":"code","source":"colSums(is.na(data_r))\nhead(data_r, 5)\nstr(data_r)\nsummary(data_r)\ndim(data_r)","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T10:50:08.061321Z","iopub.execute_input":"2025-05-21T10:50:08.063140Z","iopub.status.idle":"2025-05-21T10:50:08.190588Z","shell.execute_reply