{"152d5c6d-5f1c-4423-a67c-65bcea9da89b.png":{"image/png":""},"08bf51ef-ee7c-4250-86c9-e7c122fc7241.png":{"image/png":""}}},{"cell_type":"code","source":"# Türkiye Ulusal HKİ Kesme Noktaları\nhki_araliklari <- list(\n  pm10 = data.frame(\n    I_lo = c(0, 51, 101, 151, 201, 301),\n    I_hi = c(50, 100, 150, 200, 300, 500),\n    BP_lo = c(0, 51, 101, 151, 201, 301),\n    BP_hi = c(50, 100, 150, 200, 300, 500)\n  ),\n  so2 = data.frame(\n    I_lo = c(0, 51, 101, 151, 201, 301),\n    I_hi = c(50, 100, 150, 200, 300, 500),\n    BP_lo = c(0, 51, 101, 151, 201, 301),\n    BP_hi = c(50, 100, 150, 200, 300, 500)\n  ),\n  no2 = data.frame(\n    I_lo = c(0, 51, 101, 151, 201, 301),\n    I_hi = c(50, 100, 150, 200, 300, 500),\n    BP_lo = c(0, 101, 201, 400, 800, 1600),\n    BP_hi = c(100, 200, 399, 799, 1599, 2000)\n  ),\n  o3 = data.frame(\n    I_lo = c(0, 51, 101, 151, 201, 301),\n    I_hi = c(50, 100, 150, 200, 300, 500),\n    BP_lo = c(0, 121, 181, 241, 401, 801),\n    BP_hi = c(120, 180, 240, 400, 800, 1000)\n  )\n)","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T10:53:18.352895Z","iopub.execute_input":"2025-05-21T10:53:18.354602Z","iopub.status.idle":"2025-05-21T10:53:18.368814Z","shell.execute_reply":"2025-05-21T10:53:18.367102Z"}},"outputs":[],"execution_count":122},{"cell_type":"markdown","source":"# # # Formül#","metadata":{}},{"cell_type":"markdown","source":"![image.png](attachment:99dab227-ed81-481a-a7ef-04ab72a81035.png)![image.png]","metadata":{},"attachments":{"99dab227-ed81-481a-a7ef-04ab72a81035.png":{"image/png":""},"d2cf4729-c588-4a8c-8e28-3d1b65f64a84.png":{"image/png":""}}},{"cell_type":"code","source":"# HKİ Hesaplama Fonksiyonu\nhesapla_hki <- function(c, pollutant) {\n  if (is.na(c)) return(NA)\n  aralik <- hki_araliklari[[pollutant]]\n  for (i in 1:nrow(aralik)) {\n    if (c >= aralik$BP_lo[i] && c <= aralik$BP_hi[i]) {\n      return(\n        (aralik$I_hi[i] - aralik$I_lo[i]) / (aralik$BP_hi[i] - aralik$BP_lo[i]) *\n          (c - aralik$BP_lo[i]) + aralik$I_lo[i]\n      )\n    }\n  }\n  return(NA)\n}","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T10:53:43.823288Z","iopub.execute_input":"2025-05-21T10:53:43.824882Z","iopub.status.idle":"2025-05-21T10:53:43.837498Z","shell.execute_reply":"2025-05-21T10:53:43.835637Z"}},"outputs":[],"execution_count":125},{"cell_type":"code","source":"library(zoo)  # rollmean için\n\ndata_r <- data_r %>%\n  arrange(datetime) %>%\n  mutate(\n    pm10_avg = rollmean(pm10, k = 24, fill = NA, align = \"right\"),\n    o3_avg   = rollmean(o3,   k = 8,  fill = NA, align = \"right\"),\n    so2_avg  = so2,\n    no2_avg  = no2\n  ) %>%\n  rowwise() %>%\n  mutate(\n    pm10_AQI = hesapla_hki(pm10_avg, \"pm10\"),\n    o3_AQI   = hesapla_hki(o3_avg, \"o3\"),\n    so2_AQI  = hesapla_hki(so2_avg, \"so2\"),\n    no2_AQI  = hesapla_hki(no2_avg, \"no2\"),\n    gen_AQI  = max(c(pm10_AQI, o3_AQI, so2_AQI, no2_AQI), na.rm = TRUE)\n  ) %>%\n  ungroup()\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T10:53:51.263325Z","iopub.execute_input":"2025-05-21T10:53:51.264949Z","iopub.status.idle":"2025-05-21T10:53:54.572363Z","shell.execute_reply":"2025-05-21T10:53:54.569729Z"}},"outputs":[],"execution_count":126},{"cell_type":"code","source":"hesapla_hki <- function(c, pollutant) {\n  if (is.na(c)) return(NA)  # Eksik gözlemler için\n  \n  aralik <- hki_araliklari[[pollutant]]\n  \n  for (i in 1:nrow(aralik)) {\n    if (c >= aralik$BP_lo[i] && c <= aralik$BP_hi[i]) {\n      return(\n        (aralik$I_hi[i] - aralik$I_lo[i]) / (aralik$BP_hi[i] - aralik$BP_lo[i]) *\n          (c - aralik$BP_lo[i]) + aralik$I_lo[i]\n      )\n    }\n  }\n  \n  return(NA)  # Eğer hiçbir aralığa girmiyorsa\n}","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T11:01:09.950763Z","iopub.execute_input":"2025-05-21T11:01:09.952470Z","iopub.status.idle":"2025-05-21T11:01:09.966784Z","shell.execute_reply":"2025-05-21T11:01:09.964614Z"}},"outputs":[],"execution_count":141},{"cell_type":"code","source":"library(dplyr)\nlibrary(zoo)  # rollmean fonksiyonu için\n\ndata_hki <- data_r %>%\n  arrange(datetime) %>%\n  mutate(\n    pm10_avg = zoo::rollmean(pm10, k = 24, fill = NA, align = \"right\"),\n    o3_avg   = zoo::rollmean(o3,   k = 8,  fill = NA, align = \"right\"),\n    so2_avg  = so2,\n    no2_avg  = no2\n  ) %>%\n  rowwise() %>%\n  mutate(\n    pm10_AQI = hesapla_hki(pm10_avg, \"pm10\"),\n    o3_AQI   = hesapla_hki(o3_avg, \"o3\"),\n    so2_AQI  = hesapla_hki(so2_avg, \"so2\"),\n    no2_AQI  = hesapla_hki(no2_avg, \"no2\"),\n    gen_AQI  = max(c(pm10_AQI, o3_AQI, so2_AQI, no2_AQI), na.rm = TRUE)\n  ) %>%\n  ungroup()\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T11:01:16.316073Z","iopub.execute_input":"2025-05-21T11:01:16.317810Z","iopub.status.idle":"2025-05-21T11:01:19.988311Z","shell.execute_reply":"2025-05-21T11:01:19.986403Z"}},"outputs":[],"execution_count":142},{"cell_type":"code","source":"library(ggplot2)\n\nggplot(data_hki, aes(x = datetime, y = gen_AQI)) +\n  \n  # Gölgelendirme katmanları (her kategori için geom_rect)\n  annotate(\"rect\", xmin = min(data_hki$datetime), xmax = max(data_hki$datetime),\n           ymin = 0, ymax = 50, fill = \"green\", alpha = 0.07) +\n  annotate(\"rect\", xmin = min(data_hki$datetime), xmax = max(data_hki$datetime),\n           ymin = 51, ymax = 100, fill = \"yellow\", alpha = 0.07) +\n  annotate(\"rect\", xmin = min(data_hki$datetime), xmax = max(data_hki$datetime),\n           ymin = 101, ymax = 150, fill = \"orange\", alpha = 0.07) +\n  annotate(\"rect\", xmin = min(data_hki$datetime), xmax = max(data_hki$datetime),\n           ymin = 151, ymax = 200, fill = \"red\", alpha = 0.07) +\n  annotate(\"rect\", xmin = min(data_hki$datetime), xmax = max(data_hki$datetime),\n           ymin = 201, ymax = 300, fill = \"purple\", alpha = 0.07) +\n  annotate(\"rect\", xmin = min(data_hki$datetime), xmax = max(data_hki$datetime),\n           ymin = 301, ymax = 500, fill = \"maroon\", alpha = 0.07) +\n  \n  # Nokta grafiği\n  geom_point(aes(color = gen_AQI), size = 1.2, alpha = 0.8) +\n  \n  # Renk skalası\n  scale_color_gradientn(\n    colors = c(\"green\", \"yellow\", \"orange\", \"red\", \"purple\", \"maroon\"),\n    limits = c(0, 500),\n    name = \"Genel AQI\"\n  ) +\n  \n  # Eşik çizgileri\n  geom_hline(yintercept = 151, color = \"red\", linetype = \"dashed\", linewidth = 0.8) +\n  geom_hline(yintercept = 201, color = \"purple\", linetype = \"dashed\", linewidth = 0.8) +\n  \n  # Etiketler\n  labs(\n    title = \"Genel Hava Kalitesi İndeksi (gen_AQI) Zaman Serisi – Kategorilere Göre Gölgelendirme\",\n    x = \"Tarih\",\n    y = \"Genel HKİ (AQI)\"\n  ) +\n  theme_minimal()","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T11:01:28.770419Z","iopub.execute_input":"2025-05-21T11:01:28.772377Z","iopub.status.idle":"2025-05-21T11:01:31.243246Z","shell.execute_reply":"2025-05-21T11:01:31.239937Z"}},"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABaAAAASwCAIAAACCY3qwAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdaXwdVcEH4DO52Zqke2lpy9qWUqDsi+wgIIiyFBEQBUQW9QVUQDZBZJFNVBAU\nBEHFBQREBUFA9h2RVZR936HQJW325N55P9ySpmmWmzRNcsrzfOivmZnMnDnnzJm5/8zMTdI0\nDQAAAAAxKxroAgAAAAAsKQEHAAAAED0BBwAAABC94oEuAMTh1uv/VpvNjd18563GVwx0WQAA\nAGgv8ZJRKMTkISWvNrRsd/1rd+6+ykCXBQAAgPY8ogIAAABEzx0cAAAAQPTcwQEAAABEb1kM\nONLmB/7yy69+YcepKyxfVV4yZOiIldfYaJ9Dv3fTv98d6JKFp3+0cZIk29/wemcLNMy5OUmS\n4rIJnS1wx84rJ0my8Y+eXirl66H5b52ZJEnF6F06nPvQBV9OkiRTMvzcuwqt+Xb18/j31kuS\nZOd7l3rDFbKh8yeP7MPC5Nd285yGwn/lt6uPTpLkqg/rer3RwuuzqfqhyUNKznhqVq+31c/S\nXO3UitIkSYoypY/VNHe+XMu9f7ro0L0+s9oqE4cNKR0+evk11t/6sBPPffjN2g4XP2vVEUmS\n7PLIB/lN7D62co9L/ldIefK/2LXXG7O92tfBJdvw5q/PPvozm6+z3MhhJcWlw0ZP2HDb3U7+\n+bXV2T67N7Cn48DSGzf6fMQbtNrVYbdnrn41iE/xi+jrci69Vuj/9m17Buy3Ez0AnxDLWsDR\nVP3YVzZfeasvHvb7v93+8vtzK0ZPrErq33z+8WsvP2e3TVfa6YhftXgip1889etvbHXU1UWZ\nih9c//Rx23Wa1/RImqt98MEHH3nsrT5ZG124YJcv1kw/6/v