\nF-statistic: 765.4 on 4 and 35059 DF,  p-value: < 2.2e-16\n"},"metadata":{}}],"execution_count":147},{"cell_type":"markdown","source":"| Değişken               | Katsayı | Etki Yönü   | Anlamlılık | Yorum                                                                       |\n| ---------------------- | ------- | ----------- | ---------- | --------------------------------------------------------------------------- |\n| (Intercept)            | 245.59  | -           | \\*\\*\\*     | Ortalama koşullarda gen\\_AQI başlangıç seviyesi.                            |\n| **Sıcaklık (temp)**    | +0.043  | **Pozitif** | \\*         | Sıcaklık arttıkça gen\\_AQI çok hafif artıyor. Ancak etki düşük.             |\n| **Bağıl Nem (rhum)**   | –0.091  | **Negatif** | \\*\\*\\*     | Nem arttıkça hava kalitesi iyileşiyor. Anlamlı ve güçlü etki.               |\n| **Rüzgar Hızı (wspd)** | –0.465  | **Negatif** | \\*\\*\\*     | Rüzgar arttıkça kirleticiler dağılır, gen\\_AQI düşer. En güçlü etki burada. |\n| **Basınç (pres)**      | –0.184  | **Negatif** | \\*\\*\\*     | Yüksek basınçta gen\\_AQI azalıyor. Bu da önemli ve anlamlı.                 |\n","metadata":{}},{"cell_type":"markdown","source":"\n*📐 Model Performansı\n\nR² (R-kare): 0.0803 → Model, gen_AQI’deki değişkenliğin %8'ini açıklamaktadır.\n\nAdjusted R²: 0.0802 → Modelin açıklayıcılığı çok düşük ancak anlamlıdır.\n\nF-İstatistiği: 765.4, p < 0.001 → Model genel olarak anlamlıdır. \n\nYorum\n\nModel istatistiksel olarak anlamlıdır (p < 0.001).\n\nEn büyük etki rüzgar hızı üzerinden gelir (–0.465). Bu, hava sirkülasyonunun kirleticileri dağıttığını gösterir.\n\nBağıl nem ve basınç da anlamlı negatif etkiye sahiptir.\n\nSıcaklık, pozitif yönde küçük ama anlamlı bir etki göstermektedir.\n\nModelin açıklayıcılığı düşüktür (R² ≈ %8), bu da hava kalitesini etkileyen birçok başka faktörün olduğunu gösterir (trafik, sanayi, topoğrafya, inversiyon vb.).*\n","metadata":{}},{"cell_type":"markdown","source":"# # XGBoost ile gen_AQI Tahmini","metadata":{}},{"cell_type":"code","source":"# Model verisi: sadece tam satırlar\nmodel_df <- data_r %>%\n  select(gen_AQI, temp, rhum, wspd, pres) %>%\n  filter(complete.cases(.))\n\n# Hedef ve öznitelikler\ny <- model_df$gen_AQI\nx <- model_df %>% select(-gen_AQI)\n\n# xgboost formatı: DMatrix\ndtrain <- xgb.DMatrix(data = as.matrix(x), label = y)\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T11:02:59.851507Z","iopub.execute_input":"2025-05-21T11:02:59.853198Z","iopub.status.idle":"2025-05-21T11:02:59.886098Z","shell.execute_reply":"2025-05-21T11:02:59.883804Z"}},"outputs":[],"execution_count":149},{"cell_type":"code","source":"xgb_model <- xgboost(\n  data = dtrain,\n  objective = \"reg:squarederror\",  # regresyon için\n  nrounds = 100,                   # iterasyon sayısı\n  max_depth = 6,                   # ağaç derinliği\n  eta = 0.1,                       # öğrenme oranı\n  verbose = 0                     # çıktı bastırma\n)\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T11:03:04.451394Z","iopub.execute_input":"2025-05-21T11:03:04.453039Z","iopub.status.idle":"2025-05-21T11:03:05.517540Z","shell.execute_reply":"2025-05-21T11:03:05.515540Z"}},"outputs":[],"execution_count":150},{"cell_type":"code","source":"# Tahmin\nmodel_df$predicted_xgb <- predict(xgb_model, as.matrix(x))\n\n# Görsel karşılaştırma\nlibrary(ggplot2)\n\nggplot(model_df, aes(x = gen_AQI, y = predicted_xgb)) +\n  geom_point(alpha = 0.3, color = \"darkgreen\") +\n  geom_abline(slope = 1, intercept = 0, color = \"red\", linetype = \"dashed\") +\n  labs(title = \"XGBoost: Gerçek vs Tahmin gen_AQI\",\n       x = \"Gerçek gen_AQI\", y = \"Tahmin gen_AQI\") +\n  theme_minimal()\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T11:03:10.316937Z","iopub.execute_input":"2025-05-21T11:03:10.318562Z","iopub.status.idle":"2025-05-21T11:03:12.998677Z","shell.execute_reply":"2025-05-21T11:03:12.995653Z"}},"outpu