markdown","source":"Grafikte yatay eksende gerçek gen_AQI, dikey eksende ise model tarafından tahmin edilen gen_AQI yer almaktadır. Noktalar, modelin tahmin performansını göstermektedir. Kırmızı kesikli çizgi ideal durumu (y = x) temsil eder; bu çizgi üzerindeki tüm noktalar mükemmel tahmini göstermektedir.","metadata":{}},{"cell_type":"markdown","source":"Model, düşük ve orta seviyedeki gen_AQI değerleri için yeterince iyi tahminlerde bulunabilmekte, ancak uç değerlerdeki gen_AQI tahminleri için performansı düşmektedir.\n\nBu durum aşağıdaki yöntemlerle geliştirilebilir:\n\nAğırlıklı hata fonksiyonu: Yüksek AQI değerlerine daha fazla ceza veren özel bir loss function uygulanabilir.\n\nVeri artırımı (data augmentation): Özellikle yüksek kirlilik değerlerinin sayısını artırmak için SMOTE gibi tekniklerle dengesizliğin önüne geçilebilir.\n\nMevsimsel ve bölgesel özelliklerin modele dahil edilmesiyle tahmin başarısı artırılabilir.","metadata":{}},{"cell_type":"code","source":"# Ortalama Hata (MAE) ve Ortalama Kare Hata (RMSE)\nmae <- mean(abs(model_df$gen_AQI - model_df$predicted_xgb))\nrmse <- sqrt(mean((model_df$gen_AQI - model_df$predicted_xgb)^2))\n\ncat(\"MAE:\", round(mae, 2), \"\\n\")\ncat(\"RMSE:\", round(rmse, 2), \"\\n\")\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T11:03:22.957027Z","iopub.execute_input":"2025-05-21T11:03:22.958671Z","iopub.status.idle":"2025-05-21T11:03:22.990226Z","shell.execute_reply":"2025-05-21T11:03:22.987501Z"}},"outputs":[{"name":"stdout","text":"MAE: 11.71 \nRMSE: 16.28 \n","output_type":"stream"}],"execution_count":152},{"cell_type":"markdown","source":"","metadata":{}},{"cell_type":"markdown","source":"# #  Feature Importance (Öznitelik Önemi) Analizi","metadata":{}},{"cell_type":"code","source":"library(xgboost)\n\n# Model verisi\nmodel_df <- data_r %>%\n  select(gen_AQI, temp, rhum, wspd, pres) %>%\n  filter(complete.cases(.))\n\n# Bağımlı ve bağımsız değişkenler\ny <- model_df$gen_AQI\nx <- model_df %>% select(-gen_AQI)\n\n# DMatrix formatına dönüştür\ndtrain <- xgb.DMatrix(data = as.matrix(x), label = y)","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T11:03:26.842803Z","iopub.execute_input":"2025-05-21T11:03:26.844575Z","iopub.status.idle":"2025-05-21T11:03:26.877858Z","shell.execute_reply":"2025-05-21T11:03:26.875514Z"}},"outputs":[],"execution_count":153},{"cell_type":"code","source":"xgb_model <- xgboost(\n  data = dtrain,\n  objective = \"reg:squarederror\",\n  nrounds = 100,\n  max_depth = 4,\n  eta = 0.1,\n  verbose = 0\n)","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T11:03:34.934806Z","iopub.execute_input":"2025-05-21T11:03:34.936490Z","iopub.status.idle":"2025-05-21T11:03:35.690893Z","shell.execute_reply":"2025-05-21T11:03:35.688465Z"}},"outputs":[],"execution_count":154},{"cell_type":"code","source":"importance_matrix <- xgb.importance(model = xgb_model)\nprint(importance_matrix)","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T11:03:44.054444Z","iopub.execute_input":"2025-05-21T11:03:44.056428Z","iopub.status.idle":"2025-05-21T11:03:44.093509Z","shell.execute_reply":"2025-05-21T11:03:44.089434Z"}},"outputs":[{"name":"stdout","text":"   Feature      Gain     Cover Frequency\n    <char>     <num>     <num>     <num>\n1:    wspd 0.4215798 0.1704165 0.1540597\n2:    temp 0.2578469 0.2951194 0.3129771\n3:    rhum 0.1692256 0.1711336 0.2303956\n4:    pres 0.1513477 0.3633305 0.3025677\n","output_type":"stream"}],"execution_count":155},{"cell_type":"markdown","source":"| Değişken               | Gain     | Açıklama                                                                                                                                                                       |\n| ---------------------- | -------- | ------------------------------------------------------------------------------------------------------------------------------------------------------------------------------ |\n| **wspd** (Rüzgar hızı) | **0.42** | En yüksek etkiye sahip değişkendir. Modelin karar ağacında en bilgilendirici parametredir. Yani `gen_AQI` değerini tahmin ederken en fazla katkıyı sağlamıştır.                |\n| **temp** (Sıcaklık)    | **0.26** | Orta düzeyde etkiye sahip. Sıcaklık değişimleri hava kalitesi üzerinde kayda değer bir etki yaratmaktadır.                                                                     |\n| **rhum** (Bağıl nem)   | **0.17** | Daha düşük ama yine anlamlı bir etkisi vardır. Nem oranı kirletici gazların konsantrasyonunu etkileyebilir.                                                                    |\n| **pres** (Basınç)      | **0.15** | Modelde en az etkili değişkendir, ancak bazı dönemlerde etkili olabilir. Gain düşük olsa da **Cover** ve **Frequency** yüksek, yani sık kullanılmış ancak etkisi düşük kalmış. |\n","metadata":{}},{"cell_type":"markdown","source":"# XGBoost ile Tahmin","metadata":{}},{"cell_type":"markdown","source":"Simülasyon İçin 2025 Saatlik Veri Seti Oluştur","metadata":{}},{"cell_type":"code","source":"library(dplyr)\nlibrary(lubridate)\nlibrary(xgboost)\n\n# Gecikmeli (lag) özellikler ekle\ndata_r <- data_r %>%\n  arrange(datetime) %>%\n  mutate(\n    hour  = hour(datetime),\n    month = month(datetime),\n    lag_1   = lag(gen_AQI, 1),\n    lag_24  = lag(gen_AQI, 24),\n    lag_168 = lag(gen_AQI, 168)\n  ) %>%\n  drop_na()\n\n# Model girdileri\nX <- data_r %>% select(temp, rhum, wspd, pres, hour, month, lag_1, lag_24, lag_168)\ny <- data_r$gen_AQI\n\ndtrain <- xgb.DMatrix(data = as.matrix(X), label = y)\n\n# XGBoost modeli\nxgb_model <- xgboost(\n  data = dtrain,\n  nrounds = 200,\n  objective = \"reg:squarederror\",\n  eval_metric = \"rmse\",\n  verbose = 0\n)\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T11:16:45.933374Z","iopub.execute_input":"2025-05-21T11:16:45.935877Z","iopub.status.idle":"2025-05-21T11:16:51.239752Z","shell.execute_reply":"2025-05-21T11:16:51.237828Z"}},"outputs":[],"execution_count":160},{"cell_type":"code","source":"# Yeni tahmin veri seti (2025 yılı için)\nfuture_data <- data.frame(\n  datetime = seq.POSIXt(from = as.POSIXct(\"2025-01-01 00:00:00\"),\n                        to   = as.POSIXct(\"2025-12-31 23:00:00\"),\n                        by   = \"1 hour\")\n)\n\n# Ortalama değerlerle doldur (örnek tahmin için)\nfuture_data <- future_data %>%\n  mutate(\n    temp  = mean(data_r$temp, na.rm = TRUE),\n    rhum  = mean(data_r$rhum, na.rm = TRUE),\n    wspd  = mean(data_r$wspd, na.rm = TRUE),\n    pres  = mean(data_r$pres, na.rm = TRUE),\n    hour  = hour(datetime),\n    month = month(datetime),\n    lag_1   = NA,\n    lag_24  = NA,\n    lag_168 = NA\n  )\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T11:17:09.640946Z","iopub.execute_input":"2025-05-21T11:17:09.642638Z","iopub.status.idle":"2025-05-21T11:17:09.669806Z","shell.execute_reply":"2025-05-21T11:17:09.667969Z"}},"outputs":[],"execution_count":161},{"cell_type":"code","source":"# Önceki tahminleri saklamak için vektör\nfuture_preds <- rep(NA, nrow(future_data))\n\nfor (i in 169:nrow(future_data)) {\n  # İlk 168 saat tahmin yapılamaz çünkü lag_168 NA\n  if (i >= 169) {\n    future_data$lag_1[i]   <- future_preds[i - 1]\n    future_data$lag_24[i]  <- future_preds[i - 24]\n    future_data$lag_168[i] <- future_preds[i - 168]\n    \n    row_x <- future_data[i, c(\"temp\", \"rhum\", \"wspd\", \"pres\", \"hour\", \"month\", \"lag_1\", \"lag_24\", \"lag_168\")]\n    row_matrix <- xgb.DMatrix(data = as.matrix(row_x))\n    \n    # Tahmini al\n    future_preds[i] <- predict(xgb_model, row_matrix)\n  }\n}\n\n# Sonuçları veri setine ekle\nfuture_data$pred_gen_AQI <- future_preds\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T11:17:26.484987Z","iopub.execute_input":"2025-05-21T11:17:26.486582Z","iopub.status.idle":"2025-05-21T11:17:44.254478Z","shell.execute_reply":"2025-05-21T11:17:44.252205Z"}},"o